import React from "react";

const style: React.CSSProperties = {
    color: 'blue',
    padding: '0.5em'
}

const Header: React.FC = () => {
    return (
        <div style={style}>
            <img src={`${process.env.PUBLIC_URL}/hutte.png`}  alt="hutte.png" />
        </div>
    );
}

export default Header;
